import React, { Component } from "react";
import GenNavBar from "./navbar/GenNavBar";

import Grid from "@material-ui/core/Grid";
import HeaderContent from "./content/HeaderContent";
import "../../../../index.css";
import Paper from "@material-ui/core/Paper";
import Sign from "../../components/ui/Sign";
import Typography from "@material-ui/core/Typography";
import Link from "@material-ui/core/Link";
import HomeIcon from "./HomeIcon";

class HomePage extends Component {
  signInNav = () => {
    this.props.history.push("/signin");
  };

  signUpNav = () => {
    this.props.history.push("/signup");
  };

  render() {
    return (
      <div>
        <Grid
          container
          style={{
            background: "transparent",
          }}
        >
          <Grid item xs={12}>
            <GenNavBar
              signInNav={this.signInNav}
              signUpNav={this.signUpNav}
            ></GenNavBar>
          </Grid>
          <Grid
            item
            xs={12}
            style={{
              height: "57rem",
              background: "transparent",
              border: "1px soild red",
            }}
          >
            <HeaderContent signUpNav={this.signUpNav}></HeaderContent>
          </Grid>

          <Grid item xs={12} style={{ padding: "2rem" }}></Grid>
          <Grid item xs={1}>
            <Paper
              style={{
                height: "25rem",
                background: "transparent",
                boxShadow: "none",
              }}
            ></Paper>
          </Grid>
          <Grid item xs={10}>
            <div
              style={{
                height: "25rem",
                borderRadius: "5rem",
                boxShadow: "none",
                background: "linear-gradient(to right , #86abf9, #6893ee)",
              }}
            >
              <div
                style={{
                  height: "30%",
                }}
              >
                <h4
                  style={{
                    fontSize: "3rem",
                    fontFamily: "Manrope",
                    fontWeight: "bold",
                    color: "white",
                    paddingTop: "4rem",
                    textAlign: "left",
                    paddingLeft: "3rem",
                    width: "40rem",
                  }}
                >
                  Manage your funds
                </h4>
              </div>
              <div
                style={{
                  height: "40%",
                }}
              >
                <p
                  style={{
                    fontSize: "2rem",
                    fontFamily: "Manrope",
                    fontWeight: 200,
                    color: "white",
                    textAlign: "left",
                    paddingLeft: "3rem",
                    paddingRight: "3rem",
                  }}
                >
                  Say good bye to excel, transform your funds monitoring ways.
                  Get control of your monetary and lay path for your goals.
                </p>
              </div>
              <div
                style={{
                  height: "30%",
                  textAlign: "left",
                  paddingLeft: "3rem",
                }}
              >
                <Sign signUpNav={this.props.signUpNav} action={"signup"}></Sign>
              </div>
            </div>
          </Grid>
          <Grid item xs={1}>
            <Paper
              style={{
                height: "25rem",
                background: "transparent",
                boxShadow: "none",
              }}
            ></Paper>
          </Grid>
          <Grid item xs={1}>
            <Paper
              style={{
                height: "25rem",
                background: "transparent",
                boxShadow: "none",
              }}
            ></Paper>
          </Grid>
          <Grid item xs={10}>
            <div
              style={{
                height: "25rem",
                boxShadow: "none",
              }}
            >
              <div style={{ height: "8rem" }}></div>
              <div style={{ height: "2rem" }}>
                <div
                  style={{
                    width: "auto",
                    float: "left",
                  }}
                >
                  <Typography
                    variant="h5"
                    style={{
                      textAlign: "left",
                      flexGrow: 1,
                      fontFamily: "Lobster",
                    }}
                  >
                    <Link href="/" style={{ color: "#2a6bf4" }}>
                      My Portfolio
                    </Link>
                  </Typography>
                </div>

                <div
                  style={{
                    width: "auto",
                    float: "left",
                  }}
                >
                  <HomeIcon style={{ color: "#2a6bf4" }}></HomeIcon>
                </div>

                <div
                  style={{
                    width: "68%",
                    border: "thin transparent solid",
                    float: "left",
                  }}
                ></div>

                <div
                  style={{
                    width: "5%",

                    float: "left",
                  }}
                >
                  LinkedIn
                </div>
                <div
                  style={{
                    width: "5%",

                    float: "left",
                  }}
                >
                  Twitter
                </div>
                <div
                  style={{
                    width: "5%",

                    float: "left",
                  }}
                >
                  Blog
                </div>
                <div
                  style={{
                    width: "5%",

                    float: "left",
                  }}
                >
                  FAQ
                </div>
              </div>

              <div style={{ height: "2rem" }}></div>

              <hr
                style={{
                  textAlign: "left",
                }}
              ></hr>

              <div style={{ height: "2rem" }}></div>

              <div style={{ height: "2rem" }}>
                <div
                  style={{
                    width: "12%",
                    textAlign: "left",
                    float: "left",
                  }}
                >
                  @MyPortfolioHome.inc
                </div>

                <div
                  style={{
                    width: "10%",

                    float: "left",
                  }}
                >
                  Terms & Conditions
                </div>

                <div
                  style={{
                    width: "10%",

                    float: "left",
                  }}
                >
                  Privacy Policy
                </div>

                <div
                  style={{
                    width: "58%",
                    border: "thin transparent solid",
                    float: "left",
                  }}
                ></div>

                <div
                  style={{
                    width: "10%",

                    float: "left",
                  }}
                >
                  Language: English
                </div>
              </div>
              <div style={{ height: "9rem" }}></div>
            </div>
          </Grid>
          <Grid item xs={1}>
            <Paper
              style={{
                height: "25rem",
                background: "transparent",
                boxShadow: "none",
              }}
            ></Paper>
          </Grid>
        </Grid>
      </div>
    );
  }
}

export default HomePage;
